(11, 'Helado Casero de Fresas', '<div><b>Preparaci', 'img/tip-tabla/LRd2YoZhI37LIZy5f6c1MqAYfeUvaX9me3baWwK4.png', '2018-12-04 20:39:18', '2019-03-17 04:53:22', NULL),
(13, 'Pur√© de manzana', 'Delicioso y cuida tu salud.', 'img/tip-tabla/onlKFyWUOAC3VLVmPmUN9AP67WRdV6hokDnmZiq4.jpeg', '2018-12-04 20:39:18', '2019-04-27 11:03:47', NULL),
(15, 'Smoothie de Fresa & Avena', '<p>Delicioso y nutritivo. Para empezar el d', 'img/tip-tabla/LsCD8XyCSsbzgXFaaRvIFgvKGgiXMOPiYLMdPs6z.jpeg', '2018-12-11 02:42:15', '2019-01-23 21:28:53', NULL),
(16, 'Queque de Manzana', '<p><b>Preparaci', 'img/tip-tabla/CxtYo28AOr13JV1JgLk4pfvEJXf8lbXTuHIpKy0C.png', '2019-03-17 04:58:51', '2019-03-17 04:58:51', NULL),
(17, 'PL√ÅTANOS PRIMAVERA', '<p>PL√ÅTANOS PRIMAVERA</p><p>DERRETIR LA MANTEQUILLA EN UNA SART√âN Y AGREGAR EL AZ√öCAR MEZCL√ÅNDOLA CONSTANTEMENTE. AGREGAR EN RON Y POSTERIORMENTE LOS PL√ÅTANOS EN TROZOS.<br></p><p><br></p><p>SE SIRVEN CALIENTES</p>', 'img/tip-tabla/OWjWW6IayTtekWonNoNrub1nT03ewzpDbc0DYTFj.png', '2019-06-20 21:55:07', '2019-06-20 21:55:07', NULL),
(18, 'Arroz con Leche', '<p>1. Calienta el agua con la canela en una olla a fuego alto y deja que hierva durante 5 minutos para que salga el sabor de la canela. Luego agrega el arroz, reduce el fuego a bajo, tapa y cocina hasta que el arroz est√© cocido y el agua haya sido absorbida, aproximadamente 20 minutos.</p><p><br></p><p>2. Agrega poco a poco la leche de vaca y luego la leche evaporada. Revuelve con mucho cuidado al mismo tiempo que incorporas el az√∫car.</p><p><br></p><p>3. Cocina sin tapar durante 10 minutos m√°s o el tiempo necesario para alcanzar la consistencia deseada. Si lo deseas, espolvorea con canela al momento de servir.</p><p><br></p><p>AHORA A DISFRUTARLO.</p>', 'img/tip-tabla/f3NSeJpcCiJQy9vSKvqlyspqwS6Fxln3XJMGS7J9.png', '2019-06-21 00:57:29', '2019-06-21 00:57:29', NULL),
(19, 'PICARONES', '<p>Primero pela el zapallo y camotes, c√≥rtalos en cuadros para que se cocine m√°s r√°pido y ponlos a hervir en una olla con 3 tazas de agua junto con el an√≠s, el clavo de olor y las ramas de canela</p><p>Cuando el zapallo y el camote est√©n cocinados ponlos en un recipiente separ√°ndolos de los dem√°s ingredientes. Luego hay que hacerlos pur√©, para eso puedes usar lo que tengas a mano y sea m√°s f√°cil para ti, como por ejemplo, un tenedor, prensapapas o licuadora</p><p>Ahora aseg√∫rate de que el l√≠quido restante de la cocci√≥n est√© tibio (s√≥lo dos tazas), ponlo en un recipiente de cristal (de preferencia) y agrega la levadura, 4 cucharadas de az√∫car, una pizca de sal, mezcla bien y deja reposar por 15 minutos aproximadamente. El resultado despu√©s de este tiempo debe ser que la levadura haya crecido</p><p>Vamos con la masa, en un bol agrega el pur√© de zapallo y camote, a continuaci√≥n la levadura antes preparada y mezcla fuertemente hasta que se mezcle completamente. Luego echa la mitad de la harina y el l√≠quido restante del pur√© de zapallo y camote, mezcla fuertemente hasta que quede una consistencia ligosa, despu√©s de un rato agregas la otra mitad de la harina y si lo prefieres un poquito de agua para facilitar la mezcla. Es posible que sientas que te falta un poco de harina, si lo crees conveniente agrega un poco m√°s pero poco a poco sin pasarte. El resultado final es una masa ligosa que no se pega f√°cilmente en las manos</p><p><br></p><p>&nbsp;</p><p>Cubre la masa con un pa√±o o tela y d√©jalo reposar por 2 horas aproximadamente</p><p>Ahora aprovecha este tiempo para preparar la Miel de Chancaca, la receta est√° m√°s abajo</p><p>Despu√©s de las 2 horas debe de haber crecido la masa. Luego calienta una sart√©n y echa aceite generosamente, recuerda que los Picarones deben flotar mientras los fr√≠es</p><p>El aceite debe estar caliente pero no demasiado porque los Picarones se fr√≠en r√°pido y si lo tienes muy caliente no te dar√° tiempo para poner y quitar</p><p><br></p><p>&nbsp;</p><p>Prepara un bol con agua y ponlo cerca para que mojes tus dedos entre picaron y picaron</p><p>Para fre√≠r, primero moja tus dedos en el agua, luego coge un poco de masa entre tus dedos, ac√©rcate a la sart√©n y crea un circulo con un orificio en el centro (como un donut) y ponlo en el aceite caliente con mucho cuidado de no quemarte. Si el orifico no aparece o no sale bien puedes ayudarte con una cuchara de palo para hacerlo</p><p>vigila que no se quemen porque se fr√≠en r√°pido, cuando veas que se ponen un poco morenos dale la vuelta. ¬°Pero no te quedes mirando! ?? prepara otro picaron y agr√©galo a la sart√©n. Depende de cada persona coger el ritmo entre poner y dar la vuelta sin que se quemen. Estoy seguro que con la practica te convertir√°s en un ‚Äúmaestro picaronero‚Äù</p><p>Y listo, ¬°Buen provecho!</p>', 'img/tip-tabla/pObl2IeZxkAtq3qzKlYofte1roZ3TwqgRE94byZz.png', '2019-06-21 00:59:15', '2019-06-21 00:59:15', NULL),
(20, 'JUGO SURTIDO ESPECIAL', '<p>Colocar todos las frutas que desees en el vaso de la licuadora y licuar hasta que est√©n todos los ingredientes bien mezclados, probar con una cuchara si est√° a punto el dulce o agregarle m√°s miel seg√∫n el gusto de la persona.</p><p><br></p><p><b>Batishake:</b> Se le puede agregar un par de cubos de hielo para que quede fresquito. Lo mejor es beberlo inmediatamente.</p><p><br></p><p>Opci√≥n: La betarraga le da ese darle color caracter√≠stico al jugo surtido peruano.</p><p><br></p><p>A disfrutar y vivir bien!</p>', 'img/tip-tabla/7lVw5mvQQrLl9MlkXStn0WtVvpN449AblonWU6qk.png', '2019-06-21 01:06:02', '2019-06-21 01:06:02', NULL),
(21, 'ROLLITOS DE PL√ÅTANO', '<p>1. Pelamos los pl√°tanos y los cortamos en trozos de unos tres cent√≠metros de largo. Quitamos la corteza y los huesecillos del bac√≥n o panceta.</p><p><br></p><p>2. Enrollamos alrededor de un trozo de pl√°tano el bac√≥n y sujetamos el rollito con un palillo. Calentamos un poco de aceite en una sart√©n y doramos los rollitos hasta que el bac√≥n est√© crujiente.</p><p><br></p><p>3. Los servimos con el palillo para que sean f√°ciles de coger. Se consumen calientes.</p><p><br></p><p>Que disfrutes!</p>', 'img/tip-tabla/enccbiRk0QszpLX3xpmMvNnYTirj4phGFKC2KFJI.png', '2019-06-21 01:08:17', '2019-06-21 01:08:17', NULL),
(22, 'PUDIN DE PL√ÅTANO', '<p>1. Introducir la mantequilla en un vaso y meterla al microondas unos segundos hasta que se derrita. Dejar enfriar.</p><p>2. En un bol aparte, introducir los pl√°tanos troceados, los huevos enteros, la miga de pan, las magdalenas, el lim√≥n escurrido, la leche y la mantequilla que ten√≠amos reservada, una vez fr√≠a.<br></p><p>3. Batirlo todo bien con el minipimer, hasta que todos los ingredientes queden bien mezclados. Reservar.<br></p><p>4. Coger un molde apto para microondas y engrasarlo con mantequilla.<br></p><p>5. A continuaci√≥n verter la mezcla que ten√≠amos reservada, e introducir en el microondas a potencia max. durante 20 √≥ 25 minutos.<br></p><p>6. Transcurrido este tiempo pinchar el puding con un palillo y si sale limpio es que ya esta finalizado. Dejar enfriar.<br></p><p>7. Meterlo en la nevera durante 2 horitas. Desmoldar y decorar al gusto.</p><p>8. Se puede decorar haciendo circulo con diferentes tipos de frutas combinandolas por colores.</p><p>9. O simplemente poniendo az√∫car por toda la base y quemandola con una pala de quemar az√∫car (la de la crema catalana).</p><p>10. NOTA. Se puede hacer la noche anterior para cosumirlo al d√≠a siguiente, esta m√°s bueno.</p><p>A disfrutar!</p>', 'img/tip-tabla/xBuuPp0fYYhv9t599f1bvvZc1le2kXoBTmoLLx1L.png', '2019-06-21 01:10:47', '2019-06-21 01:10:47', NULL),
(23, 'QUNTU PISCO SOUR', '<p>El mejor Pisco Sour</p>', 'img/tip-tabla/Esw30PkvGJkBjYzZP03vWs8DvlJnuM4jPIywXQ5p.jpeg', '2020-04-27 01:26:01', '2020-04-27 01:26:01', NULL),
(24, 'CHILCANO', '<p>Un trago para todos.</p>', 'img/tip-tabla/Mwvw6L5QMv2gNPWjgVPhSPUNKlmOLNvzx9Kgbn2I.jpeg', '2020-04-27 01:26:53', '2020-04-27 01:26:53', NULL);
